import React, {Component} from 'react';
import {Button} from 'semantic-ui-react';
import {Link} from '../../../routes';
import Layout from '../../../components/Layout';

export default class RequestIndex extends Component {
  render() {
    return (
      <Layout>
        <h3>Request</h3>
      </Layout>
    );
  }
}
